import React, { Component } from "react";
import { Link, Route } from "react-router-dom";
//style importer
import * as style__ from "./style";
//component importer

//import module
import APIDemo from './../../modules/api/socketsetup';

//utils importer
interface Props {
  // isFormDisPlay: (status: boolean) => void;
  // stateUser: boolean;
}
type State = typeof initState;

const initState = {
  status: false as boolean,
};
export default class RegisterForm extends Component<Props, State> {
  state = initState;
  module = new APIDemo();
  formDisplay = () => {
    
    // this.props.isFormDisPlay(!this.props.stateUser);
  };

  onchangeinput = () => {

  }
  componentWillMount(){
    console.log("componenWillMount");
  }

  componentWillUnmount(){
    console.log("componentWillUnmount");
  }

  handleRegister = (status: boolean) => {
    const formdata = new FormData();
    formdata.append('abc','1234');
    this.module.userRegister(
      formdata,
      (res:any)=>{
      console.log(res.data)},
      (err:any)=>{
        console.log(err);
      }
    );
  };

  formRegister = () => {
    return (
      <Route path="/register">
        <div
          style={{
            position: "absolute",
            top: "50%",
            left: "50%",
            transform: "translate(-50%,-50%)",
          }}
        >
          <form action="">
            <label>
              {"Họ và tên:"}
              <input 
                type="text"
                value=""
                placeholder=""
                onChange={this.onchangeinput}
              />
            </label>

            <label>
              {"CMND: "}
              <input type="text" />
            </label>

            <label>
              {"Ngày sinh: "}
              <input type="text" />
            </label>

            <label>
              {"Giới tính: "}
              <input type="text" />
            </label>

            <label>
              {"Địa chỉ: "}
              <input type="text" />
            </label>

            <label>
              {"Số điện thoại: "}
              <input type="text" />
            </label>

            <label>
              {"Email: "}
              <input type="text" />
            </label>

            <label>
              {"Password: "}
              <input type="password" />
            </label>

            <span onClick={() => this.handleRegister(!this.state.status)}>
              Đăng ký
            </span>

            <span onClick={this.formDisplay}>Cancel</span>
          </form>
        </div>
      </Route>
    );
  };

  render() {
    return <React.Fragment>{this.formRegister()}</React.Fragment>;
  }
}
